As we discussed, there are more inconsistencies in the way we are dealing with new data. In `postAdd`, we do different things; and deserialization also has inconsistencies:

1. Some `postAdd` code changes actual data (`raw` -> `processed`)
   * For this, we want to pass an `isRaw` (instead of `applyPostAdd`) parameter for decision making in `Collection.postAdd`.
   * Maybe, we can split `postAdd` into two: `postAddRaw` (only called if `isRaw`) and `postAddProcessed` (always called)?
2. Maintain internal data structures (similar to `CollectionIndex`)
   * As it turns out, this is only used in `PDP`. We can replace all those cases with a slightly generalized `CollectionIndex` (see code below).
   * The main idea is to allow an `Index` to store (i) any type of key (not just integer) and (ii) customized storage per key (e.g. `Set` instead of `Array` or anything you want).
   * NOTE: In order to support non-array containers per key, override:  `get`, `getFirst`, `addEntryToKey`, `createNewContainerForKey`. Possibly consider batching these functions together, similar to the `*IndexManager` objects? (But not necessary)
3. `PDP` and `RDP` are also not quite consistent in the way that `deserialize` is implemented. Can we bring them closer together?


# New `CollectionIndex` idea:

```js
import { newLogger } from '@dbux/common/src/log/logger';
import EmptyObject from '@dbux/common/src/util/EmptyObject';


const ArrayIndexManager = {
  createNew() {
    return [];
  },

  getAllKeys() {
    // ...
  }
};

const MapIndexManager = {
  // ...
  createNew() {
    return new Map();
  },

  // TODO
};

/**
 * In order to support non-array containers per key, override:
 * `get`, `getFirst`, `addEntryToKey`, `createNewContainerForKey`
 * 
 * @template {T}
 */
export default class CollectionIndex {
  /**
   * @type {DataProvider}
   */
  dp;
  name;

  /**
   * @type {T[][]}
   */
  _byKey;

  constructor(collectionName, indexName, { addOnNewData = true, stringKey = false } = EmptyObject) {
    this.collectionName = collectionName;
    this.name = indexName;
    this.log = newLogger(`${indexName} (Index)`);
    this.addOnNewData = addOnNewData;
    this.stringKey = stringKey;

    // TODO: change `stringKey` to `isMap` (instead of array)
    if (this.stringKey) {
      // this._manager = ...
    }
    else {
      // this._manager = ...
    }
  }

  _init(dp) {
    this.dp = dp;
    if (this.stringKey) {
      this._byKey = {};
    }
    else {
      this._byKey = [];
    }
  }

  /**
   * @param {number} key 
   * @return {T[]}
   */
  get(key) {
    return this._byKey[key];
  }

  getFirst(key) {
    const ofKey = this.get(key);
    return ofKey?.[0] || null;
  }

  getAllKeys() {
    const keys = [];
    for (let i = 0; i < this._byKey.length; ++i) {
      if (this._byKey[i]) {
        keys.push(i);
      }
    }
    return keys;
  }

  /**
   * @param {T[]} entries 
   */
  addEntries(entries) {
    for (const entry of entries) {
      this.addEntry(entry);
    }
  }

  /**
   * @param {T} entry 
   */
  addEntry(entry) {
    const key = this.makeKey(this.dp, entry);
    if (key === undefined) {
      // debugger;
      this.log.error('makeKey returned undefined');
      return;
    }
    if (key === false) {
      // entry is filtered out; not part of this index
      return;
    }

    // TODO: fix `this._byKey[key]`. Use manager instead.
    const ofKey = (this._byKey[key] = this._byKey[key] || this.createNewContainerForKey(key));
    this.beforeAdd?.(ofKey, entry);
    this.addEntryToKey(ofKey, entry);

    // sanity check
    // if (ofKey.includes(undefined)) {
    //   this.log.error('Index contains undefined values', key, entry, ofKey);
    // }
  }

  createNewContainerForKey(key) {
    return [];
  }

  addEntryToKey(ofKey, entry) {
    ofKey.push(entry);
  }

  addEntryById(id) {
    const entry = this.dp.collections[this.collectionName].getById(id);
    this.addEntry(entry);
  }

  /** 
   * Returns a unique key (number) for given entry.
   * @param {DataProvider} dp
   * @param {T} entry 
   */
  makeKey(/* dp, entry */) {
    throw new Error(`abstract method not implemented: ${this.constructor.name}.makeKey`);
  }
}
```

